import React, { useState, useEffect } from 'react';
import axios from 'axios';

const LeaveHistory = () => {
  const [leaveHistory, setLeaveHistory] = useState([]);
  const [error, setError] = useState('');
  const token = localStorage.getItem('token');

  useEffect(() => {
    // Fetch leave history when the component is mounted
    const fetchLeaveHistory = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:8000/api/leave/history/', {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        if (response.status === 200) {
          setLeaveHistory(response.data);
        }
      } catch (err) {
        console.error('Error fetching leave history:', err);
        setError('Failed to fetch leave history. Please try again later.');
        if (err.response) {
          // Server responded with a status other than 200
          console.error('Server responded with status:', err.response.status);
          console.error('Response data:', err.response.data);
        } else if (err.request) {
          // Request was made but no response received
          console.error('No response received:', err.request);
        } else {
          // Something else happened
          console.error('Error during request setup:', err.message);
        }
      }
    };

    fetchLeaveHistory();
  }, [token]);

  return (
    <div className="leave-history">
      <h2>Leave History</h2>
      {error && <p className="text-red-500">{error}</p>}
      {leaveHistory.length === 0 ? (
        <p>No leave history available.</p>
      ) : (
        <table className="leave-history-table">
          <thead>
            <tr>
              <th>Leave Type</th>
              <th>Start Date</th>
              <th>End Date</th>
              <th>Reason</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {leaveHistory.map((leave) => (
              <tr key={leave.id}>
                <td>{leave.leave_type}</td>
                <td>{new Date(leave.start_date).toLocaleDateString()}</td>
                <td>{new Date(leave.end_date).toLocaleDateString()}</td>
                <td>{leave.reason || 'N/A'}</td>
                <td>{leave.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default LeaveHistory;
